import { useState } from "react";
import { useNavigate } from "react-router-dom";
import { Menu, Dropdown, Button, Row, Col } from "antd";
import "./index.scss";

const HeaderPage = () => {
  const navigate = useNavigate();

  const menuItems = [
    {
      label: "Trang chủ",
      key: "main",
    },
    {
      label: "Tra cứu học phần",
      key: "termSearch",
    },
    {
      label: "Thời khóa biểu",
      key: "schedule",
    },
    {
      label: <div className="information">123456789|Nguyen Van A</div>,
      key: null,
      children: [
        { label: "Đăng xuất", key: "logout" },
        {
          label: "Xem thông tin cá nhân",
          key: "personalInformation",
        },
      ],
      style: {
        position: "absolute",
        right: "0",
      },
    },
  ];
  const personalInforItems = [
    {
      label: "Đăng xuất",
      key: "logout",
    },
    {
      label: "Xem thông tin cá nhân",
      key: "personalInfor",
    },
  ];
  return <Menu mode="horizontal" items={menuItems} className="header-menu" />;
};
export default HeaderPage;
